;let myMap;

const init = () => {
  myMap = new ymaps.Map("map", {
    center: [55.752, 37.576],
    zoom: 14,
    controls: []
  });

  const coords = [
    [55.752004, 37.576133]
  ];

  const myCollection = new ymaps.GeoObjectCollection({}, {
    draggable: false, 
    iconLayout: 'default#image',
    iconImageHref: "./img/icons/map-marker.svg",
    iconImageSize: [46, 57],
    iconImageOffSet: [-35, -52]
  })
  
  coords.forEach(coord => {
    myCollection.add(new ymaps.Placemark(coord));
  })
  myMap.geoObjects.add(myCollection);
  myMap.behaviors.disable('scrollZoom');
};

ymaps.ready(init);;(function() {
  const mesureWidth = (item) => {
    let reqItemWidth = 0;

    const screenWidth = $(window).width();
    const container = item.closest(".products-menu__list");
    const titlesBlocks = container.find(".products-menu__title");
    const titleWidth = titlesBlocks.width() * titlesBlocks.length;

    const textContainer = item.find(".products-menu__container");
    const paddingLeft = parseInt(textContainer.css("padding-left"));
    const paddingRight = parseInt(textContainer.css("padding-right"));

    const isMobile = window.matchMedia("(max-width: 768px)").matches;

    if (isMobile) {
      reqItemWidth = screenWidth - titleWidth;
    } else {
      reqItemWidth = 500;
    }

    return {
      container: reqItemWidth,
      textContainer: reqItemWidth - paddingRight - paddingLeft
    }
  }
  
  const closeEveryItemInContainer = (container) => {
    const items = container.find(".products-menu__item");
    const content = container.find(".products-menu__content");

    items.removeClass("active");

    content.width(0);
  }

  const openItem = (item) => {
    const hiddenContent = item.find(".products-menu__content");
    const textBlock = item.find(".products-menu__container");
    const reqWidth = mesureWidth(item);

    item.addClass("active");
    hiddenContent.width(reqWidth.container);
    textBlock.width(reqWidth.textContainer);
  }
  
  $(".products-menu__title").on('click', e => {
    e.preventDefault();
    const $this = $(e.currentTarget);
    const item = $this.closest(".products-menu__item");
    const itemOpened = item.hasClass("active");
    const container = $this.closest(".products-menu__list");

    if (itemOpened) {
      closeEveryItemInContainer(container)
    } else {
      closeEveryItemInContainer(container)
      openItem(item);
    }
  });
})();const overlay = document.querySelector(".overlay");
const hamburger = document.querySelector(".hamburger");
const body = document.body;

const links = document.querySelectorAll('.overlay .menu__link');

links.forEach((element) => {
  element.addEventListener("click",  toggleMenu);
})

function toggleMenu(element) {
  element.preventDefault();
  overlay.classList.toggle("overlay--active");
  hamburger.classList.toggle("hamburger--active");
  hamburger.classList.toggle("body--active-menu");
}

